import React from "react";
import { Link } from "react-router-dom";

function AboutPage() {
    return(
        <BasicLayout>
            <div className={'text-3xl'}>About Page</div>
            
            <div>
                <Link to={'/about'}>About</Link>
            </div>
        </BasicLayout>
    );
}

export default AboutPage;
